import React, { useState } from 'react';
import styled from 'styled-components'
import { LinkButton } from '../styles/Link'

var HeaderContainer = styled.header`
    display: flex;
    // margin-left: 10em;
    // width: 100%;

    box-shadow: 0 1px 6px 0 rgba(32,33,36,.28);
    height: 72px;
`;

var HomeContainer = styled.div`
    display: flex;
    flex-flow: column;
    // justify-content: center;

    width: 60%;

`;

var Header = () => {
    // Declare a new state variable, which we'll call "count"
    //   const [count, setCount] = useState(0);

    return (
        // <AdjustHome>
        <HeaderContainer>
            <LinkButton to="csv">Csv Generation</LinkButton>
            <LinkButton to="config">Config Generation</LinkButton>
        </HeaderContainer>
        /* </AdjustHome > */
    );
}

export { Header };
